import React from 'react';
import {
  Container,
  City,
  Time,
  Temperature,
  Location,
} from './MyLocationCard.styled';

function MyLocationCard({weather}) {

  return (
    <Container onClick={() => console.log('myLocationCard')}>
      <div
        style={{
          display: 'flex',
          flexDirection: 'row',
          justifyContent: 'space-between',
          alignItems: 'stretch',
        }}
      >
        <City>My Location</City>
        {/* <Temperature>{weather.main.temp}</Temperature> */}
      </div>
      <div
        style={{
          display: 'flex',
          flexDirection: 'row',
          justifyContent: 'space-between',
          alignItems: 'center',
        }}
      >
        <Time>15:45</Time>
        <Location>H:{Math.trunc(weather.coord.lat)} L:{Math.trunc(weather.coord.lon)}</Location>
      </div>
    </Container>
  );
}  

export default MyLocationCard;
